'suite/chrome/mailnews/compose/composeMsgs.properties:12598' => 'Klaida išsiunčiant laišką: nepavyko patvirtinti savo tapatumo SMTP serveriui %S. Serveris nepalaiko jokio su programa suderinamo nesaugaus tapatumo patikrinimo būdo, o nuostatose parinktas nesaugus tapatybės tikrinimas. Pabandykite parinkti saugų tapatybės tikrinimą, arba susisiekite su savo paslaugos teikėju.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12599' => 'Klaida išsiunčiant laišką: nepavyko patvirtinti savo tapatumo SMTP serveriui %S. Serveris nepalaiko jokio su programa suderinamo saugaus tapatumo patikrinimo būdo, o nuostatose parinktas saugus tapatybės tikrinimas. Pabandykite parinkti nesaugų tapatybės tikrinimą, arba susisiekite su savo paslaugos teikėju.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12592' => 'Laiško išsiųsti nepavyko, nes baigėsi ryšiui su SMTP serveriu %S skirtas laikas. Bandykite vėl, arba susisiekite su tinklo administratoriumi.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12593' => 'Laiško išsiųsti per SMTP serverį %S nepavyko dėl nežinomos priežasties. Patikrinkite SMTP paskyros nuostatas ir bandykite vėl, arba susisiekite su tinklo administratoriumi.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12590' => 'Laiško išsiųsti nepavyko, nes nepavyko prisijungti prie SMTP serverio %S. Serveris gali būti nepasiekiamas arba nepriimti SMTP ryšių. Patikrinkite SMTP paskyros nuostatas ir bandykite vėl, arba susisiekite su serverio administratoriumi.',
'suite/chrome/mailnews/messenger.dtd:msgMenu.label' => 'Laiškas',
'suite/chrome/mailnews/compose/composeMsgs.properties:12596' => 'SMTP serveris %S neleidžia jungtis su nešifruotu slaptažodžiu. Pabandykite pakeisti tapatumo tikrinimo nuostatos reikšmę šios paskyros serverio nuostatose į „Šifruotas slaptažodis“.',
